import React from "react";
// import Products from "../DB/products.json";
// import { Headphones } from "./Headphones";

export const Headphone = (props, match) => {
  const headphone = props.item.find(
    ({ model }) => model === match.params.headphoneId
  );
  return (
    <div>
      headphones
      {headphone.brand}
    </div>
  );
};
